import Vue from "vue";
import { createApp } from "vue";
import App from "./App.vue";
import router from "./router";
import store from "./store";

Vue.use(vueDebounce);

createApp(App).use(router, store).mount("#app");

new Vue({
  router,
  store,
  render: (h) => h(App),
}).$mount("#app");
